import React, {
	Component
} from 'react';
export default class Test extends Component {
	constructor() {
		super()
		this.state = {
			flag: false
		}
    	this.handleClick = this.handleClick.bind(this);
	}

	handleClick(name, e) {
		console.log(name);
		console.log(e);
		this.setState({
			flag: !this.state.flag
		});
	}
	render() {
		return (
			// <div onClick={(e)=>this.handleClick(e)}>shabi</div>
			<div onClick={this.handleClick.bind(this, "aaa")}>this.state.flag</div>
		);
	}
}
